(1576, 'Selbstwert', '•Stärkung der Selbstwahrnehmung und des Selbstwertgefühls, •Erarbeitung eines Bewusstseins für die eigenen Lebensumstände, •Zuversichtliche Lebenseinstellung und Selbstbewusstsein, •Eigene Bedürfnisse erkennen und nutzen, •Motivationstechniken und Lernmethoden', 0, '2021-06-15 09:37:00', 15, 69.7, ''),
