(1578, 'Durchhaltevermögen & Belastbarkeit', '•Analyse von bestehenden Widerständen und Abwehrmechanismen mit Integration in den Coachingverlauf, •Sozialberatung – Hemmnisse aufdecken, Lösungswege aufzeigen, lebenspraktische Hilfen organisieren, •Reflexion und Aufarbeitung bisheriger Handlungsmuster, •Hilfestellung zum Lösen bestehender Blockaden', 0, '2021-06-15 09:37:00', 15, 69.7, ''),
(1579, 'Möglichkeiten & Visionen', '•künftige Entwicklungsfelder, ungenutzte Potentiale, •Werteanalyse (Stärken, Schwächen, Chancen, Risiken), •persönliche Zielstellung & Umsetzung, •Wege und Chancen zum Erfolg', 0, '2021-06-15 09:37:00', 15, 69.7, ''),
(1580, 'Struktur, Organisation & Zeitmanagement', '•in Partnerschaft/ Familie, im Beruf, •Tagesplanung, Hilfen zur Zeitorganisation, •Zeitfallen erkennen und umwandeln, Prioritäten ermitteln, •flexibler Umgang mit Störungen, •Haushaltsführerschein - Haushalts und Finanzplanung', 0, '2021-06-15 09:37:00', 15, 69.7, ''),
(1581, 'Stressbewältigung', '•Stressarten, Stresstypen, Instrumentelles Stressmanagement , Mentales Stressmanagement, Regeneratives Stressmanagement z.B.', 0, '2021-06-15 09:37:00', 10, 69.7, ''),
