(2402, 'Selbstwert', '•Stärkung der Selbstwahrnehmung und des Selbstwertgefühls, •Erarbeitung eines Bewusstseins für die eigenen Lebensumstände, •Zuversichtliche Lebenseinstellung und Selbstbewusstsein, •Eigene Bedürfnisse erkennen und nutzen, •Motivationstechniken und Lernmethoden', 0, '2021-10-15 14:01:27', 15, 69.7, ''),
(2403, 'Selbst- & Fremdwahrnehmung Teil 1', '•Arten der Wahrnehmungen, Urteilssysteme, •Auseinandersetzung mit dem bisherigen Lebensweg als Resultat für die eigene Wahrnehmung, •Analyse von Stärken und Schwächen der eigenen Person, •Ressourcenanalyse, •Selbstpräsentation', 0, '2021-10-15 14:01:27', 15, 69.7, ''),
(2404, 'Durchhaltevermögen & Belastbarkeit', '•Analyse von bestehenden Widerständen und Abwehrmechanismen mit Integration in den Coachingverlauf, •Sozialberatung – Hemmnisse aufdecken, Lösungswege aufzeigen, lebenspraktische Hilfen organisieren, •Reflexion und Aufarbeitung bisheriger Handlungsmuster, •Hilfestellung zum Lösen bestehender Blockaden', 0, '2021-10-15 14:01:27', 15, 69.7, ''),
(2405, 'Möglichkeiten & Visionen', '•künftige Entwicklungsfelder, ungenutzte Potentiale, •Werteanalyse (Stärken, Schwächen, Chancen, Risiken), •persönliche Zielstellung & Umsetzung, •Wege und Chancen zum Erfolg', 0, '2021-10-15 14:01:27', 15, 69.7, ''),
(2406, 'Struktur, Organisation & Zeitmanagement', '•in Partnerschaft/ Familie, im Beruf, •Tagesplanung, Hilfen zur Zeitorganisation, •Zeitfallen erkennen und umwandeln, Prioritäten ermitteln, •flexibler Umgang mit Störungen, •Haushaltsführerschein - Haushalts und Finanzplanung', 0, '2021-10-15 14:01:27', 15, 69.7, ''),
(2407, 'Stressbewältigung', '•Stressarten, Stresstypen, Instrumentelles Stressmanagement , Mentales Stressmanagement, Regeneratives Stressmanagement z.B.', 0, '2021-10-15 14:01:27', 10, 69.7, ''),
(2408, 'Grundlagen Kommunikation Teil 1', '•Grundlagen der Kommunikation, •verbale & nonverbale Kommunikation ausbauen, •Feedbacktechniken und aktives Zuhören, •Das perfekte Auftreten (Outfit, Make-up, 1. Eindruck), •Sympathiepunkte sammeln durch Small Talk, •Abbau von Gesprächsblockaden', 0, '2021-10-15 14:01:27', 15, 69.7, ''),
(2409, 'Weg-Ziel-Planung (online)', '•Berufs- & Arbeitsorientierung, •Anforderungen & Qualifikationen, •Chancen ausloten und positionieren, •Fördermöglichkeiten & Weiterbildung erkennen und nutzen', 0, '2021-10-15 14:01:27', 20, 69.7, ''),
(2410, 'Selbst- & Fremdwahrnehmung Teil 2 (online)', '•Emotionsarbeit, •Haltung zu sich selbst und anderen, •Grundlegende Eigenschaften – Selbstpräsentation, •Grundlegende Eigenschaften – Selbstpräsentation', 0, '2021-10-15 14:01:27', 15, 69.7, ''),
(2411, 'Kommunikation Teil 2 (online)', '•Rhetorik & Selbstpräsentation, •Stimmtraing, •Kameraarbeit zur Selbst & Fremdbildanalyse, •Kundengespräche & besondere Situationen', 0, '2021-10-15 14:01:27', 15, 69.7, ''),
(2412, 'Professionelle Bewerbungsunterlagen', 'Unterlagen erstellen, Outfitcheck, Farb- & Stilberatung, Bewerbungbilder erstellen, Word / Excel kompakt, Online / Video-Bewerbung, Jobbörseprofil erstellen / verbessern', 0, '2021-10-15 14:01:27', 50, 69.7, ''),
