(2791, 'Selbstwert', '•Stärkung der Selbstwahrnehmung und des Selbstwertgefühls, •Erarbeitung eines Bewusstseins für die eigenen Lebensumstände, •Zuversichtliche Lebenseinstellung und Selbstbewusstsein, •Eigene Bedürfnisse erkennen und nutzen, •Motivationstechniken und Lernmethoden', 0, '2021-10-15 14:41:01', 15, 69.7, ''),
