(2793, 'Durchhaltevermögen & Belastbarkeit', '•Analyse von bestehenden Widerständen und Abwehrmechanismen mit Integration in den Coachingverlauf, •Sozialberatung – Hemmnisse aufdecken, Lösungswege aufzeigen, lebenspraktische Hilfen organisieren, •Reflexion und Aufarbeitung bisheriger Handlungsmuster, •Hilfestellung zum Lösen bestehender Blockaden', 0, '2021-10-15 14:41:01', 15, 69.7, ''),
(2794, 'Möglichkeiten & Visionen', '•künftige Entwicklungsfelder, ungenutzte Potentiale, •Werteanalyse (Stärken, Schwächen, Chancen, Risiken), •persönliche Zielstellung & Umsetzung, •Wege und Chancen zum Erfolg', 0, '2021-10-15 14:41:01', 15, 69.7, ''),
(2795, 'Struktur, Organisation & Zeitmanagement', '•in Partnerschaft/ Familie, im Beruf, •Tagesplanung, Hilfen zur Zeitorganisation, •Zeitfallen erkennen und umwandeln, Prioritäten ermitteln, •flexibler Umgang mit Störungen, •Haushaltsführerschein - Haushalts und Finanzplanung', 0, '2021-10-15 14:41:01', 15, 69.7, ''),
