INSERT INTO `quali_textblocks` (`id`, `qual_id`, `text_blk`) VALUES
(1, 1, 'Sie finden die Weiterbildung zur Fachberaterin unter folgender Maßnahmenummer: 922/83/21.'),
(2, 1, 'Die Gesamtkosten der Maßnahme betragen 13.384,80 Euro, somit beläuft sich der monatliche Kostensatz auf 1.673,10 Euro.'),
(3, 1, 'Der nächstmögliche Starttermin für die Maßnahme ist der startdatum'),
(4, 1, 'Im Anhang finden Sie den detaillierten Lehrplan für die Weiterbildung zur Fachberaterin für Beauty & Kosmetik. Diese 8-monatige Weiterbildung besteht aus einer 6-monatigen kaufmännischen und fachpraktischen Theoriephase und einer anschließenden 2-monatigen Fachpraxis bei einem unserer namenhaften Kooperationsunternehmen. Damit erhält Name Kunde Autofill die Möglichkeit den IHK-Abschluss zu erlangen.'),
(5, 2, 'Sie finden die Umschulung zur/zum Verkäuferin unter folgender Maßnahmenummer: 922/69/21.\r\n'),
(6, 2, 'Die Gesamtkosten der Maßnahme betragen 22.050,24 Euro, somit beläuft sich der monatliche Kostensatz auf 1.378,14 Euro.'),
(7, 2, 'Der nächstmögliche Starttermin für die Maßnahme ist der startdatum'),
(8, 2, 'Im Anhang finden Sie den detaillierten Lehrplan für die Umschulung zum/zur Verkäufer/in für Beauty & Kosmetik. Diese 16-monatige Umschulung besteht aus einer 12-monatigen kaufmännischen und fachpraktischen Theoriephase und einem anschließenden 4-monatigen Pflichtpraktikum bei einem unserer namenhaften Kooperationsunternehmen. Damit erhält Name Kunde Autofill die Möglichkeit den IHK-Abschluss zu erlangen.'),
(9, 3, 'Sie finden die Umschulung zur/zum Kauffrau/mann im Einzelhandel unter folgender Maßnahmenummer: 922/85/21.'),
(10, 3, 'Die Gesamtkosten der Maßnahme betragen 27.555,00 Euro, somit beläuft sich der monatliche Kostensatz auf 1.148,13 Euro.'),
(11, 3, 'Der nächstmögliche Starttermin für die Maßnahme ist der startdatum'),
(12, 3, 'Im Anhang finden Sie den detaillierten Lehrplan für die Umschulung zum/zur Kauffrau/mann im Einzelhandel für Beauty & Kosmetik. Diese 24-monatige Umschulung besteht aus einer 18-monatigen kaufmännischen und fachpraktischen Theoriephase und einem anschließenden 6-monatigen Pflichtpraktikum bei einem unserer namenhaften Kooperationsunternehmen. Damit erhält Name Kunde Autofill die Möglichkeit den IHK-Abschluss zu erlangen. ');
